CREATE TABLE r17_verificador_monitoramento (
	r17_cdempresa BIGINT,
	r17_cdverificador BIGINT,
	r17_cdtipoverificador BIGINT,
	r17_cdmonitoramento BIGINT,
	r17_cdnivel1 BIGINT,
	r17_cdnivel2 BIGINT,
	r17_cdnivel3 BIGINT,
	r17_cdnivel4 BIGINT,
	r17_lgdadosanaliticos BOOLEAN,
	r17_lgdadosagrupados BOOLEAN,
	r17_txcoletaanalitica VARCHAR(200),
	r17_txcoletaagrupada VARCHAR(200),

	PRIMARY KEY(r17_cdempresa,r17_cdverificador,r17_cdtipoverificador,r17_cdmonitoramento),
	
	CONSTRAINT monitoramento_fk FOREIGN KEY(r17_cdmonitoramento,r17_cdempresa) REFERENCES d18_monitoramento(d18_cdmonitoramento,d18_cdempresa),
	CONSTRAINT verificador_m_fk FOREIGN KEY(r17_cdempresa,r17_cdverificador,r17_cdtipoverificador) REFERENCES p01_verificador_m(p01_cdempresa,p01_cdverificador,p01_cdtipoverificador)
	 

);

